insert  into `ost_filter_rule`(`id`,`filter_id`,`what`,`how`,`val`,`isactive`,`notes`,`created`,`updated`) values (1,1,'email','equal','test@example.com',1,'','2014-12-02 16:40:54','2014-12-02 16:40:54');

